import React from "react";
import { gql } from "apollo-boost";
import { useQuery } from "@apollo/react-hooks";

const GET_MOVIES = gql`
  {
    movies {
      id
      medium_cover_image
    }
  }
`;

function Home() {
  const { loding } = useQuery(GET_MOVIES);
  console.log(loding);

  return <div></div>;
}
export default Home;
